import { Link } from "react-router-dom";

import NavBar from "./NavBar";
import { useSelector } from "react-redux";

const Header = () => {
  const isLogin = useSelector((state) => state.login.isAuthenthicated);
  console.log(isLogin);
  return (
    <div className="flex justify-around bg-[#f5deb3] p-5 mb-3 hover:bg-transparent">
      <h1 className=" text-slate-800 text-2xl font-bold">Meetup</h1>
      <NavBar></NavBar>
      <div className="flex flex-row  justify-start align-middle pl-5 pl-5 ">
        {!isLogin && (
          <Link to="/login" className="pr-8 align-middle font-medium text-lg">
            Login
          </Link>
        )}
        {!isLogin && (
          <button className=" bg-[#dc143c] rounded-full hover:ring-2 hover:ring-blue-500 pt-1 pb- pl-6 pr-6">
            <Link to="/signup">Sing Up</Link>
          </button>
        )}
        {isLogin && <button className="{classes.btn_round">Buy Tickets</button>}
      </div>
    </div>
  );
};
export default Header;
